// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

interface IOracle {
    function requestUserData(uint256 userId) external;
}

contract UserOrderAPI {
    address public oracle;
    address public owner;

    // Event to emit API data
    event UserDataFetched(uint256 userId, string response);

    modifier onlyOwner() {
        require(msg.sender == owner, "Not authorized");
        _;
    }

    constructor(address _oracle) {
        oracle = _oracle;
        owner = msg.sender;
    }

    // Request user data from Oracle
    function fetchUserData(uint256 userId) public onlyOwner {
        IOracle(oracle).requestUserData(userId);
    }

    // Oracle will call this function with API response
    function fulfillUserData(uint256 userId, string memory response) public {
        require(msg.sender == oracle, "Only Oracle can call this");
        emit UserDataFetched(userId, response);
    }
}
